import logo from '../modules/images/logo2.svg';
import FormStart from '../modules/containers/FormStart';
im



const Start = () => {
  return(
    <div>
      <img className='start__logo' src={logo} alt=""></img>
      <h1 className='start__title'>Добро пожаловать</h1>
      <FormStart />
    </div>
  )
}

export default Start;
